class Service < ActiveRecord::Base
	belongs_to :user
	belongs_to :driver
	has_one :status
	has_one	:feedback
	belongs_to :tipo_vehicle
	belongs_to :payment_method
	has_many :addresses_services
	has_many :addresses, :through => :addresses_services


	accepts_nested_attributes_for :addresses
	accepts_nested_attributes_for :addresses_services

	after_commit :set_costo_estimado, on: :create
	
	def get_status(service)
		status = Status.find_by(id: service.status_id)
	end
	def set_costo_estimado
		service = Service.last
		adrs = Service.last.addresses_services

		a1 = Address.find(adrs[0].address_id)
		a2 = Address.find(adrs[1].address_id)
		d1 = District.find(a1.district_id)
		d2 = District.find(a2.district_id)
		service.ss_costo_estimado = get_costo_estimado(d1.no_distrito, d2.no_distrito)
		service.save
	end

	def get_cod_confirmacion
		months = ['A','B','C','D','E','F','G','H','I','J','K','L']
	 	y = Time.now.strftime("%y")
	 	m = months[Time.now.month-1]
	 	d = Time.now.strftime("%d")
	 	time_range = Time.now.midnight..Time.now
	 	count = (Service.where(created_at: time_range)).count
	 	c = "%03d" % count
	 	result = y + m + d + c
	end

